import React from "react";
import "./Form.css";

function NewForm() {
  return (
    <div>
        <br>
        Username
      <input type="text"/>
      </br>
        <br>Age (year)
      <input type="number"/></br>
        
      <button type="submit">Add user</button>
    </div>
  );
}

export default NewForm;
